import React, { useState, useEffect } from "react";
// import { saveAs } from 'file-saver'
let sourceimage = "";
let nameoftype = "";
const hro = 1000;
const g = 9.81;

const MP = () => {
  const [UH, setUH] = useState("");
  const [CTC, setCTC] = useState("");
  const [alpha, setalpha] = useState("");
  const [FH, setFH] = useState("");
  const [ε, setε] = useState("");
  const [S, setS] = useState("");
  const [Sc, setSc] = useState("");
  const [changecheckbox, setchangecheckbox] = useState(false);
  const [changecheckbox1, setchangecheckbox1] = useState(false);
  const [PE, setPE] = useState("");
  const [fj, setfj] = useState("");
  const [ft, setft] = useState("");
  const [eg, seteg] = useState("");
  const [et, setet] = useState("");
  const [hj, sethj] = useState("");
  const [hg, sethg] = useState("");
  const [Q, setQ] = useState("");
  const [Q1, setQ1] = useState("");
  const [H, setH] = useState("");
  const [H1, setH1] = useState("");
  const [ηt, setηt] = useState(5);
  const [Pt, setPt] = useState("");

  function calCTC(e) {
    setCTC(e.target.value);
  }
  function calalpha(e) {
    setalpha(e.target.value);
  }
  function calS(e) {
    setS(e.target.value);
  }
  function calSc(e) {
    setSc(e.target.value);
  }
  function calfj(e) {
    setfj(e.target.value);
  }
  function calft(e) {
    setft(e.target.value);
  }
  function caleg(e) {
    seteg(e.target.value);
  }
  function calet(e) {
    setet(e.target.value);
  }
  function calhj(e) {
    sethj(e.target.value);
  }
  function calhg(e) {
    sethg(e.target.value);
  }
  function calQ(e) {
    setQ(e.target.value);
  }
  function calQ1(e) {
    setQ1(e.target.value);
  }
  function calH(e) {
    setH(e.target.value);
  }
  function calH1(e) {
    setH1(e.target.value);
  }
  function calηt(e) {
    setηt(e.target.value);
  }

  useEffect(() => {
    function realfunction1() {
      if (changecheckbox1) {
        setalpha(1);
        setCTC(0.09);
      }
      if (!changecheckbox1) {
        setalpha("");
        setCTC("");
      }
    }
    realfunction1();
  }, [changecheckbox1]);

  useEffect(() => {
    function realfunction() {
      if (changecheckbox) {
        sethg(0.07);
        sethj(0.01);
        setet(0.85);
        seteg(0.9);
        setft(0.1);
        setfj(0.01);
      }
      if (!changecheckbox) {
        sethg("");
        sethj("");
        setet("");
        seteg("");
        setft("");
        setfj("");
      }
    }
    realfunction();
  }, [changecheckbox]);

  function eventCalculate_1() {
    setPt(Number(hro) * Number(g) * Number(Q) * Number(H) * (String(ηt) / 100));
  }
  function eventCalculate_2() {
    setPE(
      Number(hro) *
        g *
        Number(Q1) *
        (Number(H1) - Number(hg) + Number(hj)) *
        Number(et) *
        Number(eg) *
        (1 - Number(ft)) *
        (1 - Number(fj))
    );
  }

  function eventCalculate_3() {
    setε(Number(Sc) / Number(S));
  }
  function eventCalculate_4() {
    setFH(Math.sqrt(1 / alpha + CTC));
  }

  if (ηt <= 55) {
    nameoftype = "Пелтон (ковшова)";
    sourceimage =
      "https://www.tyazhmash.com/r/_content/32013ce4ad24862062adcfc2daf60c2e/pelton-2.png";
  }
  if (ηt <= 65 && ηt > 55) {
    nameoftype = "Тюрго";
    sourceimage =
      "https://tamarhydro.com.au/wp-content/uploads/2015/06/Turgo_Hydro_Turbines1.png";
  }
  if (ηt <= 75 && ηt > 65) {
    nameoftype = "Томсон(пропе-лерна)";
    sourceimage =
      "https://st.depositphotos.com/1734770/4166/i/600/depositphotos_41661599-stock-photo-speedboat-propeller.jpg";
  }
  if (ηt <= 80 && ηt > 75) {
    nameoftype = "Шнекова";
    sourceimage =
      "https://img.directindustry.com/images_di/photo-mg/29492-8247036.jpg";
  }
  if (ηt <= 85 && ηt > 80) {
    nameoftype = "Каплан(пово-ротно-лопатева)";
    sourceimage =
      "https://www.tyazhmash.com/r/_content/3b9d96849c21d023021a1a2350b55d41/kaplan-8-meters-v2-s.png";
  }
  if (ηt <= 95 && ηt > 85) {
    nameoftype = "Френсіс(радіально-осьова)";
    sourceimage =
      "https://www.tyazhmash.com/f/1/products/hydro/hydraturbines/francis/francis.png";
  }

  return (
    <>
      <div className="main_containar">
        <div className="PowerTurbin">
          <h1 className="Formula№1Header">
            Потужність, яка розвивається гідротурбіною
          </h1>
          <h1 className="Formula№1FormulaText"> Формула </h1>
          <b className="Formula№1Formula">
            {" "}
            P<sub>т</sub> = <span>&rho;</span> ⋅ g ⋅ Q ⋅ Н ⋅ η <sub>T</sub>
          </b>
          <h1 className="Formula№1FormulaVariables"> Змінні </h1>
          <b className="rho">
            &rho;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;кг/м
            <sup>3</sup>
          </b>
          <span className="rhotext">Густина води</span>
          <input className="rhoinput" type="number" value={hro} readOnly />
          <b className="g">
            g&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м/с
            <sup>2</sup>{" "}
          </b>
          <span className="gtext">Прискорення вільного падіння</span>
          <input className="ginput" type="number" value={g} readOnly />
          <b className="Q">
            Q&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;л/с{" "}
          </b>
          <span className="Qtext">Витрата води</span>
          <input className="Qinput" type="number" value={Q} onChange={calQ} />
          <b className="Н">
            Н&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м{" "}
          </b>
          <span className="Htext">Робочий напір</span>
          <input className="Нinput" type="number" value={H} onChange={calH} />
          <b className="ηT">
            η<sub>T</sub>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;%
          </b>
          <span className="ηTtext">Повний ККД турбіни</span>
          <input className="ηTinput" type="number" value={ηt} readOnly />
          <input
            className="KKD"
            type="range"
            min="5"
            max="95"
            step="5"
            onChange={calηt}
          />
          <h1 className="Formula№1ResultHeader"> Результат Вт: </h1>
          <input
            className="Formula№1Result"
            name="result"
            type="number"
            value={Pt}
            readOnly
          />
          <input
            type="submit"
            className="CalculateFormula№1"
            onClick={eventCalculate_1}
            value="Обчислити"
          />
          <label className="LabelTypeOfTurbins">
            Рекомендована турбіна під ККД:{" "}
          </label>
          <label className="LabelTypeOfTurbins1"> {nameoftype} </label>
          <div className="TypeTurbinsImage">
            {" "}
            <img
              className="TypeTurbinsCurrentImg"
              src={sourceimage}
              alt="Тип Турбіни"
            />
          </div>
        </div>

        <div className="ElectricPowerGenerator">
          <h1 className="Formula№2Header">Електрична потужність генератора</h1>
          <h1 className="Formula№2FormulaText"> Формула </h1>
          <b className="Formula№2Formula">
            {" "}
            P<sub>E</sub> = &rho; ⋅ g ⋅ Q ⋅ [H - ( h<sub>g</sub> + h<sub>j</sub>
            )] ⋅ e<sub>t</sub>⋅ e<sub>g</sub>) ⋅(1 - ƒ<sub>t</sub> ⋅ (1 - ƒ
            <sub>i</sub>)
          </b>
          <h1 className="Formula№2FormulaVariables"> Змінні </h1>
          <b className="rho1">
            &rho;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;кг/м
            <sup>3</sup>
          </b>
          <span className="rhotext1">Густина води</span>
          <input className="rhoinput1" type="number" value={hro} readOnly />
          <b className="g1">
            g&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м/с
            <sup>2</sup>{" "}
          </b>
          <span className="gtext1">Прискорення вільного падіння</span>
          <input className="ginput1" type="number" value={g} readOnly />
          <b className="Q1">
            Q&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;л/с{" "}
          </b>
          <span className="Qtext1">Витрата води</span>
          <input
            className="Qinput1"
            type="number"
            value={Q1}
            onChange={calQ1}
          />
          <b className="DoingNap">
            Н&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м{" "}
          </b>
          <span className="Htext1">Робочий напір</span>
          <input
            className="Нinput1"
            type="number"
            value={H1}
            onChange={calH1}
          />
          <b className="hg">
            h<sub>g</sub>
          </b>
          <span className="hgtext">Гідравлічні втрати</span>
          <input
            className="hginput"
            type="number"
            value={hg}
            onChange={calhg}
          />
          <b className="hj">
            h<sub>j</sub>
          </b>
          <span className="hjtext">Інші втрати</span>
          <input
            className="hjinput"
            type="number"
            value={hj}
            onChange={calhj}
          />
          <b className="et">
            e<sub>t</sub>
          </b>
          <span className="ettext">
            Коефіцієнт використання при середньому багаторічному стоці Q{" "}
          </span>
          <input
            className="etinput"
            type="number"
            value={et}
            onChange={calet}
          />
          <b className="eg">
            e<sub>g</sub>
          </b>
          <span className="egtext">Eфективність генератора </span>
          <input
            className="eginput"
            type="number"
            value={eg}
            onChange={caleg}
          />
          <b className="ft">
            ƒ<sub>t</sub>
          </b>
          <span className="fttext">Втрати трансформатора </span>
          <input
            className="ftinput"
            type="number"
            value={ft}
            onChange={calft}
          />
          <b className="fj">
            ƒ<sub>j</sub>
          </b>
          <span className="fjtext">Інші втрати електроенергії </span>
          <input
            className="fjinput"
            type="number"
            value={fj}
            onChange={calfj}
          />
          <h1 className="Formula№2ResultHeader"> Результат Вт: </h1>
          <input
            className="Formula№2Result"
            name="result"
            type="number"
            value={!PE ? PE : PE.toFixed(3)}
            readOnly
          />
          <input
            type="submit"
            className="CalculateFormula№2"
            onClick={eventCalculate_2}
            value="Обчислити"
          />
          <b className="RecomendVariables">
            {" "}
            Використати рекомендовані значення?{" "}
            <input
              type="checkbox"
              className="qwe"
              onClick={(e) => setchangecheckbox(!changecheckbox)}
            />
          </b>
        </div>

        <div className="СompressionLiquidJet">
          <h1 className="Formula№3Header">
            Коефіцієнт стиснення струменя рідини
          </h1>
          <h1 className="Formula№2FormulaText"> Формула </h1>
          <b className="Formula№2Formula">
            {" "}
            ε =
            <label className="top">
              S<sub>c</sub>{" "}
            </label>
            <label className="bottom">S</label>{" "}
          </b>
          <h1 className="Formula№3FormulaVariables"> Змінні </h1>
          <b className="Sc">
            S<sub>c</sub>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м
            <sup>2</sup>{" "}
          </b>
          <span className="Sctext">Cтиснений переріз струменя</span>
          <input
            className="Scinput"
            type="number"
            value={Sc}
            onChange={calSc}
          />
          <b className="S">
            S&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;м
            <sup>2</sup>{" "}
          </b>
          <span className="Stext">Переріз донного отвору </span>
          <input className="Sinput" type="number" value={S} onChange={calS} />
          <h1 className="Formula№3ResultHeader"> Результат: </h1>
          <input
            className="Formula№3Result"
            name="result"
            type="number"
            value={!ε ? ε : ε.toFixed(2)}
            readOnly
          />
          <input
            type="submit"
            className="CalculateFormula№3"
            onClick={eventCalculate_3}
            value="Обчислити"
          />
        </div>

        <div className="CostSpeed">
          <h1 className="Formula№3Header">Коефіцієнт швидкості</h1>
          <h1 className="Formula№2FormulaText"> Формула </h1>
          <b className="Formula№2Formula">
            {" "}
            φ<sub>H</sub> ={" "}
            <label className="top1">
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;{" "}
            </label>
            <label className="bottom1">
              α + ζ<sub>TC</sub>{" "}
            </label>{" "}
          </b>
          <lable className="SQRT"> &radic; </lable>
          <div className="DOTFORDESIGN"></div>
          <h1 className="Formula№4FormulaVariables"> Змінні </h1>
          <b className="alpha">α</b>
          <span className="alphatext">
            Коефіцієнт втрат на ділянці від входу в отвір до стисненого перерізу
          </span>
          <input
            className="alphainput"
            type="number"
            value={alpha}
            onChange={calalpha}
          />
          <b className="CTC">
            ζ<sub>TC</sub>
          </b>
          <span className="CTCtext">Коефіцієнт гідравлічних втрат отвору </span>
          <input
            className="CTCinput"
            type="number"
            value={CTC}
            onChange={calCTC}
          />
          <h1 className="Formula№3ResultHeader"> Результат: </h1>
          <input
            className="Formula№3Result"
            name="result"
            type="number"
            value={!FH ? FH : FH.toFixed(2)}
            readOnly
          />
          <input
            type="submit"
            className="CalculateFormula№3"
            onClick={eventCalculate_4}
            value="Обчислити"
          />
          <b className="RecomendVariables1">
            {" "}
            Використати значення для умови утворення виру?{" "}
            <input
              type="checkbox"
              className="qwe"
              onClick={(e) => setchangecheckbox1(!changecheckbox1)}
            />
          </b>
        </div>

        <div className="CostFactor">
          <h1 className="Formula№3Header">Коефіцієнт витрати</h1>
          <h1 className="Formula№2FormulaText"> Формула </h1>
          <b className="Formula№2Formula">
            {" "}
            μ<sub>H</sub> = ε ⋅ φ<sub>H</sub>{" "}
          </b>
          <h1 className="Formula№3FormulaVariables"> Змінні </h1>
          <b className="epsilon">ε</b>
          <span className="epsilontext">Уточнити</span>
          <input
            className="epsiloninput"
            type="number"
            value={!ε ? ε : ε.toFixed(2)}
          />
          <b className="FH">
            φ<sub>H</sub>
          </b>
          <span className="FHtext">Уточнити</span>
          <input
            className="FHinput"
            type="number"
            value={!FH ? FH : FH.toFixed(2)}
          />
          <h1 className="Formula№3ResultHeader"> Результат: </h1>
          <input
            className="Formula№3Result"
            name="result"
            type="number"
            value={!UH ? UH : UH.toFixed(2)}
            readOnly
          />
           <input
            type="submit"
            className="CalculateFormula№3"
            onClick={eventCalculate_5}
            value="Обчислити"
          />
        </div>
      </div>
    </>
  );
};

export default MP;
